    protected override Humidifier.AppFlow.ConnectorProfileTypes.SAPODataConnectorProfileCredentials Create()
    {
        var sAPODataConnectorProfileCredentialsResult = CreateSAPODataConnectorProfileCredentials();
        factoryAction?.Invoke(sAPODataConnectorProfileCredentialsResult);

        return sAPODataConnectorProfileCredentialsResult;
    }

    private Humidifier.AppFlow.ConnectorProfileTypes.SAPODataConnectorProfileCredentials CreateSAPODataConnectorProfileCredentials()
    {
        var sAPODataConnectorProfileCredentialsResult = new Humidifier.AppFlow.ConnectorProfileTypes.SAPODataConnectorProfileCredentials();

        return sAPODataConnectorProfileCredentialsResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.ConnectorProfileTypes.SAPODataConnectorProfileCredentials result)
    {
        base.CreateChildren(result);

        result.BasicAuthCredentials ??= BasicAuthCredentialsFactory?.Build();
        result.OAuthCredentials ??= OAuthCredentialsFactory?.Build();
    }

} // End Of Class

